import React, { Component } from 'react';
// import CoverFlowCarousel from "./components/carousel/carousel";
import FooterPage from "../../partial/components/footer";
// import AutoGrid  from "./components/Grid/mainGrid";
import FixedNavbarExample  from '../../partial/components/navbar'
import ProfileCard from '../Profile/ProfileCards';
import UserCard from 'react-ui-cards'

class Contacts extends Component {
    render() {
      return (
        <div className="Contact">
          <FixedNavbarExample />
          {/* <UserCard /> */}
          <UserCard
          cardClass='float'
          header='https://i.imgur.com/w5tX1Pn.jpg'
          avatar='https://i.imgur.com/uDYejhJ.jpg'
          name='Justin Case'
          positionName='Software Developer'
          stats={[
            {
              name: 'followers',
              value: 21
            },
            {
              name: 'following',
              value: 37
            },
            {
              name: 'posts',
              value: 117
            }
          ]}
/>
          <FooterPage />
        </div>
      );
    }
  }

  export default Contacts;
